import './App.css';
import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';
import Dashboard from './Dashboard';
import Login from './Login'

function App() {

  return (
    <div>
      <h1>Application</h1>
      <BrowserRouter>
        <Routes>
          <Route path="/dashboard">
            <Dashboard />
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
